  true,\n\t\"url\": null,\n\t\"notes\": \"_(Abstract):_  A data set of hourly values
  of solar rnradiation and meteorological elements for a 1-year period.rnrn_(Purpose):_
  \ Simulationsrnrn_(Supplemental Information):_   A TMY consists of months selected
  fromrn individual years and concatenated to form a complete year. The intendedrn
  use is for computer simulations of solar energy conversion systems and rnbuilding
  systems. Because of the selection criteria, these TMYs are not rnappropriate for
  simulations of wind energy conversion systems.rnrnA TMY provides a standard for
  hourly data for solar radiation and other rnmeteorological elements that permit
  performance comparisons of system rntypes and configurations for one or more locations.
  A TMY is not rnnecessarily a good indicator of conditions over the next year, or
  even rnthe next 5 years. Rather, it represents conditions judged to be typical rnover
  a long period of time, such as 30 years. Because they represent rntypical rather
  than extreme conditions, they are not suited for rndesigning systems and their components
  to meet the worst-case conditionsrn occurring at a location.\",\n\t\"license_title\":
